import { Link } from "react-router-dom"

export function PackagesButton() {

    return (
        <Link to="/packages" className="border w-1/2 flex flex-col items-center">
            <div className="text-3xl">Packages</div>
            <div className="text-lg">View</div>
            <div className="text-lg">Create</div>
            <div className="text-lg">Edit</div>
            <div className="text-lg">Delete</div>
        </Link>
    )
}
